  name: ForwardingNavigableMap<K,V>
  nameWithType: ForwardingNavigableMap<K,V>
  fullName: com.azure.cosmos.implementation.guava25.collect.ForwardingNavigableMap<K,V>
  type: Class
  package: com.azure.cosmos.implementation.guava25.collect
  summary: >-
    A navigable map which forwards all its method calls to another navigable map. Subclasses should override one or more methods to modify the behavior of the backing map as desired per the [decorator pattern][].


    **Warning:** The methods of `ForwardingNavigableMap` forward *indiscriminately* to the methods of the delegate. For example, overriding <xref uid="com.azure.cosmos.implementation.guava25.collect.ForwardingNavigableMap.put" data-throw-if-not-resolved="false">#put</xref> alone *will not* change the behavior of <xref uid="com.azure.cosmos.implementation.guava25.collect.ForwardingNavigableMap.putAll" data-throw-if-not-resolved="false">#putAll</xref>, which can lead to unexpected behavior. In this case, you should override `putAll` as well, either providing your own implementation, or delegating to the provided `standardPutAll` method.


    **`default` method warning:** This class does *not* forward calls to `default` methods. Instead, it inherits their default implementations. When those implementations invoke methods, they invoke methods on the `ForwardingNavigableMap`.


    Each of the `standard` methods uses the map's comparator (or the natural ordering of the elements, if there is no comparator) to test element equality. As a result, if the comparator is not consistent with equals, some of the standard implementations may violate the `Map` contract.


    The `standard` methods and the collection views they return are not guaranteed to be thread-safe, even when all of the methods that they depend on are thread-safe.



    [decorator pattern]: http://en.wikipedia.org/wiki/Decorator_pattern
  syntax:
    content: public abstract class ForwardingNavigableMap<K,V> extends ForwardingSortedMap<K,V> implements NavigableMap<K,V>
    typeParameters:
    - id: K
    - id: V
